import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import TopPage from './src/pages/TopPage';
import Kagoshima from './src/pages/Kagoshima';
import Sakurajima from './src/pages/Sakurajima';

const Stack = createStackNavigator();

const App = () => {
  return (
    // ナビゲーションコンテナを作成
    <NavigationContainer>
      {/* スタックナビゲーターを作成 */}
      <Stack.Navigator initialRouteName="TopPage" headerMode="none">
        {/* トップページ */}
        <Stack.Screen name="TopPage" component={TopPage} />
        {/* 鹿児島港ページ */}
        <Stack.Screen name="Kagoshima" component={Kagoshima} />
        {/* 桜島港ページ */}
        <Stack.Screen name="Sakurajima" component={Sakurajima} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
